import React,{Component} from 'react';
import PostData from '../Coponent/PostData';
import Navibar from '../Coponent/Navibar';
import { FaDivide } from 'react-icons/fa';

class Signin extends Component {
    constructor(){
        super()
        this.state = {
            email:"",
            password:""
        }
    }
    handleSubmit2= (event) =>{

        let url="http://127.0.0.1:8080/v2/user/login";
        const data=this.state;
        fetch(url,{
            method: 'POST',
            headers:{
                'content-type':'application/json',
                'accept':'application/xml'
            },
            body: JSON.stringify(data)
        }).then((result) => {
            result.json().then((resp)=>{
                console.warn("resp",resp)
            })
        })
    }    

    render(){
        return(
            <div>
                <h1>log in</h1>
                <input type="text" value={this.state.email} name="email"
                onChange={(data)=>{this.setState({email:data.target.value})}}/>
                <input type="password" value={this.state.password} name="password"
                onChange={(data)=>{this.setState({password:data.target.value})}}/>
                <button onClick={()=>{this.handleSubmit2()}}>
                    log in
                </button>
            </div>

        );

    }
}

export default Signin;
